import React, { Component } from "react";
import { Grommet } from "grommet";

const theme = {
  global: {
    font: {
      family: "Roboto",
      size: "14px",
      height: "20px"
    }
  }
};

class App extends Component {
  render() {
    return <Grommet theme={theme}>Hey there</Grommet>;
  }
}

export default App;
